import logo from './logo.svg';
import './App.css';
import React from 'react';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/path1" />
          <Route exact path="/path2" />
          <Route exact path="/path3" />
          <Route exact path="/path4" />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
